      out.write("        t.innerHTML = msg;\n");
      out.write("        box.appendChild(t);\n");
      out.write("        setTimeout(() => t.remove(), 5000);\n");
      out.write("    }\n");
      out.write("\n");
      out.write("    // Ban shop: bắt buộc admin_note + confirm 1 lần nữa\n");
      out.write("    function onBanShop(id) {\n");
      out.write("        const form   = document.getElementById('shopForm_' + id);\n");
      out.write("        const note   = document.getElementById('shopNote_' + id);\n");
      out.write("        const errBox = document.getElementById('shopNoteErr_' + id);\n");
      out.write("        const action = document.getElementById('shopAction_' + id);\n");
      out.write("\n");
      out.write("        if (!form || !note || !action) return false;\n");
